import React, { useState } from "react";
import IncomeCategory from "./components/IncomeCategory";
import Questionnaire from "./components/Questionnaire";

function App() {
  const [incomeType, setIncomeType] = useState(null);

  return (
    <div>
      {!incomeType && (
        <IncomeCategory onSelect={setIncomeType} />
      )}

      {incomeType && (
        <Questionnaire incomeType={incomeType} />
      )}
    </div>
  );
}

export default App;
